import React, { FC } from 'react';

import { GenericIcon } from './GenericIcon';
import { IconProps } from './types';

export const createIcon = (path: string): FC<IconProps> => {
  const Component: FC<IconProps> = (props) => (
    <GenericIcon path={path} {...props} />
  );
  return Component;
};
